import React,{Component} from 'react';
import 'tachyons';
import AOS from 'aos';
import './icon.css';

const Homeicon=()=>
{
  AOS.init();
  return(
    <div className="main flex flex-column justify-center">
    <div className="pa2 mb5 heading">
    <h1 data-aos="fade-down" data-aos-duration="1500" style={{fontFamily: 'Yusei Magic'}}>THE CREATIVE SIDE OF CODING</h1>
    <h3 className="code"  data-aos="fade-down" data-aos-duration="1200" style={{fontFamily: 'Yusei Magic'}}>  PROVIDING CREATIVE SOLUTIONS</h3>
    </div>
    <div>
    <p className="f3 letter" data-aos="fade-down" data-aos-duration="800">
    WEBSITES
    <span className="code " >|</span>
    MOBILE APPLICATIONS
    <span className="code" >|</span>
    DIGITAL MARKETING
    </p>
    </div>
    </div>

  );
}

export default Homeicon;
